  input: 'TEXT,F3A,,"In response to inquiry regarding Column B figures and incorrect
    election cylce totals, the coverage date has been corrected to reflect dates 11/8/00-11/5/02
    for this election cycle. In response to the inquiry for the debt payments for
    this period for Bob Beckel and Cather Publishing, there were no payments made
    to these entities. After investigation, it was found that the Cather Publishing
    debt was paid in full and a letter was received by our office from Cather Publishing
    stating such. This letter will be sent to the FEC for recordkeeping. The same
    for Bob Beckel and Associates. In repsonse to the inquiry regarding outstanding
    debts that were omitted from previous reports: Bellsouth, J. Wilson Dinsmore and
    Sheraton Birmingham Hotel, all are listed on this report with the current balances
    at the time. A comparison was made between this report and the previous report
    and all were listed. In response to dedbts with outstanding beginning balances
    that were not listed on our previous report, all debts were listed with the exception
    of ''Christensen McDevitt'' which was incurred on 11/1/02 and falls within the
    coverage period of the 30 Day Post General report. This is why it wasn''t listed
    on the previous 12 Day Pre General Report. All other debts are listed on the previous
    report. In response to the inquiry regarding debt owed to Bob Beckel, both debt
    amounts are identical for this report and previous report."'
